import React from "react";
import { Link } from "react-router-dom";
import "./Inicio.css";
import Homebtiinit from "../../assets/btinicio.png";

const App = (props) => {
  const checkoutHandler = () => {
    props.history.push(
      "http://localhost:4000/api/config/session=0?redirect=select:preferential"
    );
  };

  return (
    <div className="App">
      <h1>
        Peça já <br /> sua Pizza!
      </h1>

      <Link className="initbtbg">
        <img src={Homebtiinit} className="App-btn-strart" alt="logo" />
      </Link>

      <p className="IniciarP">Toque Para Iniciar</p>
    </div>
  );
};

export default App;
